pid_t RAMDISK;
static void ramdisk_driver_thread(void);
static void read(Msg *msg);
static void write(Msg *msg);

void init_ramdisk(void){
	PCB *p = create_kthread( ramdisk_driver_thread );
	RAMDISK = p->pid;
	wakeup(p);
	hal_register("ram", RAMDISK, 0);
}

static void
ramdisk_driver_thread(void){
	static Msg msg;
	while(true){
		receive(ANY, &msg);
		switch(msg.type){
			case DEV_READ:
        read(&msg);
				break;
      case DEV_WRITE:
        write(&msg);
        break;
      default:
        assert(0);
		}
	}
}
typedef struct inode_entry{
  size_t size;
  int type;
  int dev_id;
  int link;
  char pad[52];
  int index[15];
} inode_entry;
static void write(Msg *msg){
    static uint8_t *disk = (void*)file_system;
    uint32_t i;
    msg->type = 0;
    uint32_t req_pid = msg->req_pid;
    void *buf = msg->buf;
    uint32_t offset = msg->offset;
    uint32_t len = msg->len;
    uint32_t end = offset + len;
    if(offset / NR_FILE_SIZE != end / NR_FILE_SIZE){
      /* out of file bound */
      assert(0);
    }
    /* read page by page */
    uint32_t num = len % PAGE_SIZE == 0 ? (len / PAGE_SIZE) : ((len / PAGE_SIZE) + 1);
    for( i = 0; i < num; i++){
      if(i == num - 1){
        len = end - offset;
      }else{
        len = PAGE_SIZE;
      } 
      PCB *pcb = fetch_pcb(req_pid);
      inode_entry *inode = (inode_entry*)(disk + offset);
      int t = inode->index[0];
      t ++;
      copy_to_kernel(pcb, disk + offset, buf, len);
      buf += len;
      offset += len;
    }
    msg->ret = i;
    msg->dest = msg->src;
    msg->src = RAMDISK;
    send(msg->dest, msg);
}

static int count = 4;

static void read(Msg *msg){
    static uint8_t *disk;
    uint32_t i;
    uint32_t req_pid = msg->req_pid;

    if(msg->req_pid == 10 && count != 0 ){
      disk = (void*)file;
      count --;
    }else{
      disk = (void*)file_system;
    }

    void *buf = msg->buf;
    uint32_t offset = msg->offset;
    uint32_t len = msg->len;
    uint32_t end = offset + len;
    if(offset / NR_FILE_SIZE != end / NR_FILE_SIZE){
      /* out of file bound */
      assert(0);
    }
    /* read page by page */
    uint32_t num = len % PAGE_SIZE == 0 ? (len / PAGE_SIZE) : ((len / PAGE_SIZE) + 1);
    for( i = 0; i < num; i++){
      if(i == num - 1){
        len = end - offset;
      }else{
        len = PAGE_SIZE;
      } 

      PCB *pcb = fetch_pcb(req_pid);
      copy_from_kernel_mine(pcb, buf, disk + offset, len);
      buf += len;
      offset += len;

    }
    msg->ret = i;
    msg->dest = msg->src;
    msg->src = RAMDISK;
    send(msg->dest, msg);
}